import React from 'react'
import {Card, Row, Col} from 'antd'

export default class Medication extends React.Component {
    constructor(props) {
        super(props);
        this.state = ({
            meditation:
                {
                    medicine: "Fluticasone propionate (FLOVENT HFA) 110 mcg/actuation HFA Aerosol Inhaler",
                    direction: "Inhale 2 puffs twice daily and rinse your mouth thoroughly afterward - Inhalation"
                },
        });
    }
    render() {
        return (
            <div className="body-section">
                <Card title="Medication">
                    <Row className="medicine-detail">
                        <Col>Fluticasone propionate (FLOVENT HFA) 110 mcg/actuation HFA Aerosol Inhaler</Col>
                    </Row>
                    <Row>
                        <div className="medicine-direction-title"></div>
                        <Col>Inhale 2 puffs twice daily and rinse your mouth thoroughly afterward - Inhalation</Col>
                    </Row>
                </Card>
            </div>
        );
    }
}
